                                'created_by' => 0,
                            ];
                            $historical =  HistoricDoc::create($dataHistorical);
                            $refHD = "HD" . $historical->id;
                            HistoricDoc::where('id', $historical->id)->update(['reference' => $refHD, 'is_external_ms' => 0]);
                            ShineDocumentStorage::updateOrCreate([ 'object_id' => $historical->id, 'type' => HISTORICAL_DATA],
                            [
                                'path' => 'Extra_HD_Doc_PDFs/'.$path,
                                'file_name' => $path,
                                'mime' => \Storage::mimeType('Extra_HD_Doc_PDFs/'.$path),
                                'size' => \Storage::size('Extra_HD_Doc_PDFs/'.$path),
                                'addedBy' => 1,
                                'addedDate' =>  time()
                            ]);
                            $this->info("==== Create file success $prop_ref : $path\n ");
                        } else {
                            $this->info("==== File not exist $path\n ");
                        }
                    } else {
                       $this->info(" ==== Property not exist $prop_ref\n ");
                   }

                }
           }
           \DB::commit();
       } catch (\Exception $e) {
            \DB::rollback();
            dd($e);
        }
    }
}
